            <h1 className="logo mr-auto"> BandsInTown</h1>
            <nav className="nav-menu d-none d-lg-block">
            </nav>
            {/* <a  href="#search-artist" className="get-started-btn scrollto">Search Artist</a>  */}
            <a  href="#search-artist" className="get-started-btn scrollto">Search Artist</a> 
